ngs get loaded into the variables, but then it isn't applying to the end file for arrays. Everything else seems to work as expected.
**appsettings.{env}.json**
``` 
  "SQS": {
    "RunWindows": [
      {
        "Start": "04:00:00",
        "End": "21:30:00",
        "TimeZone": "UTC"
      }
    ]
  },
