 "SQS": {
    "RunWindows": [
      {
        "Start": "10:00:00",
        "End": "20:00:00",
        "TimeZone": "UTC"
      }
    ]
  }
  ```
  
  I can see the output in the pipeline is coming out as `SQS.RunWindows1.Start`, `SQS.RunWindows1.End`, `SQS.RunWindows1.TimeZone`
